javascript:(function(){a=yt.playerConfig.args.storyboard_spec;if(!a){alert("Sorry we had trouble creating a storyboard.");exit();}b=a.split("|");base=b[0].split("$")[0]+"2/M";c=b[3].split("#");sigh=c[c.length-1];t=yt.playerConfig.args.length_seconds;n=(t<60*20)?5:t/(60*4);varurls=[];varimgs="";varurl="";for(i=0;i<n;i++){url=base+i+".jpg?sigh="+sigh;imgs+="<imgsrc='"+url+"'><br/>";urls.push(url);}vartitle=yt.playerConfig.args.title;msg="<body style='margin:30pxauto;width:800px;'>"+"<h2>TITLE</h2><div>LINKS</div><div>IMAGES</div></body>";msg=msg.replace("TITLE",title);msg=msg.replace("LINKS",urls);msg=msg.replace("IMAGES",imgs);varlabnol=window.open();labnol.document.open();labnol.document.write(msg);labnol.document.close();})();